import { ILink } from '@common/interfaces/link.interface';
import { findLinksByPath } from './find-links-by-path.util';

export const findLinkByPath = (pathName: string, links: ILink[]): ILink | undefined => {
    const res = findLinksByPath(pathName, links);
    return res.length ? res[0] : undefined;
};
